var Beacon=(()=>{var a=document.querySelector("html").getAttribute("phx-socket")||"/live",r=document.querySelector("meta[name='csrf-token']").getAttribute("content");window.addEventListener("phx:beacon:page-updated",n=>{document.querySelectorAll("meta:not([name='csrf-token'])").forEach(e=>e.remove()),n.detail.meta_tags.forEach(e=>{let t=document.createElement("meta");Object.keys(e).forEach(o=>{t.setAttribute(o,e[o])}),document.getElementsByTagName("head")[0].appendChild(t)})});var c=new LiveView.LiveSocket(a,Phoenix.Socket,{params:{_csrf_token:r}});c.connect();window.liveSocket=c;})();
